PS C:\Users\Administrator> get-help Set-Content

NAME
    Set-Content
    
SYNOPSIS
    Replaces the contents of a file with contents that you specify.
    
    
SYNTAX
    Set-Content [-Value] <Object[]> [-Confirm] [-Credential <PSCredential>] [-Encoding {Unknown | String | Unicode | Byte | BigEndianUnicode 
    | UTF8 | UTF7 | UTF32 | Ascii | Default | Oem | BigEndianUTF32}] [-Exclude <String[]>] [-Filter <String>] [-Force] [-Include <String[]>] 
    -LiteralPath <String[]> [-NoNewline] [-PassThru] [-Stream <String>] [-UseTransaction] [-WhatIf] [<CommonParameters>]
    
    Set-Content [-Path] <String[]> [-Value] <Object[]> [-Confirm] [-Credential <PSCredential>] [-Encoding {Unknown | String | Unicode | Byte 
    | BigEndianUnicode | UTF8 | UTF7 | UTF32 | Ascii | Default | Oem | BigEndianUTF32}] [-Exclude <String[]>] [-Filter <String>] [-Force] 
    [-Include <String[]>] [-NoNewline] [-PassThru] [-Stream <String>] [-UseTransaction] [-WhatIf] [<CommonParameters>]
    
    Set-Content [-Encoding {Unknown | String | Unicode | Byte | BigEndianUnicode | UTF8 | UTF7 | UTF32 | Ascii | Default | Oem}] [-Force] 
    [-Stream <string>] [-Confirm] [-WhatIf] [-UseTransaction] [<CommonParameters>]
    
    
DESCRIPTION
    The Set-Content cmdlet is a string-processing cmdlet that writes or replaces the content in the specified item, such as a file. Whereas 
    the Add-Content cmdlet appends content to a file, Set-Content replaces the existing content. You can type the content in the command or 
    send content through the pipeline to Set-Content .
    In file system drives, the Set-Content cmdlet overwrites or replaces the content of one or more files with the content that you specify. 
    This cmdlet is not valid on folders.
    
    Note: This custom cmdlet help file explains how the Set-Content cmdlet works in a file system drive. For information about the 
    Set-Content cmdlet in all drives, type "Get-Help Set-Content -Path $null" or see Set-Content at 
    http://go.microsoft.com/fwlink/?LinkID=113392.
    

RELATED LINKS
    Online version: http://technet.microsoft.com/library/hh847827(v=wps.630).aspx
    Set-Content (generic); http://go.microsoft.com/fwlink/?LinkID=113392 
    FileSystem Provider 
