NAME
    Write-EventLog
    
SYNOPSIS
    Writes an event to an event log.
    
    
    Example 1: Write an event to the Application event log
    
    PS C:\>Write-EventLog -LogName "Application" -Source "MyApp" -EventID 3001 -EntryType Information -Message "MyApp added a user-requested 
    feature to the display." -Category 1 -RawData 10,20
    
    This command writes an event from the MyApp source to the Application event log.
    Example 2: Write an event to the Application event log of a remote computer
    
    PS C:\>Write-EventLog -ComputerName "Server01" -LogName Application -Source "MyApp" -EventID 3001 -Message "MyApp added a user-requested 
    feature to the display."
    
    This command writes an event from the MyApp source to the Application event log on the Server01 remote computer.




