PS C:\Users\Administrator> Get-Help Get-Date -Examples

NAME
    Get-Date
    
SYNOPSIS
    Gets the current date and time.
    
    
    Example 1: Get the date and display it
    
    PS C:\>Get-Date -DisplayHint Date
    Tuesday, June 13, 2006
    
    This command gets a DateTime object, but it displays only the date. It uses the DisplayHint parameter to indicate that only the date is 
    to be displayed.
    Example 2: Get the date and time in short format
    
    PS C:\>Get-Date -Format g
    6/13/2006 12:43 PM
    
    This command gets the current date and time and formats it in short-date and short-time format. It uses the .NET Framework g format 
    specifier (General [short date and short time]) to specify the format.
    Example 3: Get the date and time in UNIX format
    
    PS C:\>Get-Date -UFormat "%Y / %m / %d / %A / %Z"
    2006 / 06 / 13 / Tuesday / -07
    
    This command gets the current date and time and formats it as specified by the command. In this case, the format includes the full year 
    (%Y), the two-digit numeric month (%m), the date (%d), the full day of the week (%A), and the offset from UTC (Zulu).
    Example 4: Get the day of the year for the current date
    
    PS C:\>(Get-Date -Year 2000 -Month 12 -Day 31).DayOfYear
    366
    
    This command displays the day of the year for the current date. For example, December 31 is the 365th day of 2006, but it is the 366th 
    day of 2000.
    Example 5: Determine whether the date and time are adjusted for Daylight Saving Time
    
    PS C:\>$A = Get-Date
    PS C:\>$A.IsDaylightSavingTime()
    True
    
    These commands tell you whether the current date and time are adjusted for daylight saving time in the current locale.
    
    The first command creates a variable named $A, and then assigns the object retrieved by Get-Date to the $A variable. Then, it uses the 
    IsDaylightSavingTime method on the object in $A.
    
    To see the properties and methods of the DateTime object, type:
    
    `Get-Date | Get-Member`.
    Example 6: Convert the current date and time to UTC time
    
    PS C:\>$A = Get-Date
    PS C:\>$A.ToUniversalTime()
    Tuesday, June 13, 2006 8:09:19 PM
    
    These commands convert the current date and time to UTC time.
    
    The first command creates a variable named $A, and then assigns the object retrieved by Get-Date to the $A variable. Then, it uses the 
    ToUniversalTime method on the object in $A.
    Example 7: Convert a WMI DATETIME object to a .NET Framework DateTime object
    
    PS C:\>$A = Get-WmiObject Win32_Bios -Computer Server01
    PS C:\>$A | Format-List -Property Name, @{Label="BIOS Age";Expression={(Get-Date) - $_.ConvertToDateTime($_.ReleaseDate)}}
    Name     : Default System BIOS
    BIOS Age : 1345.17:31:07.1091047
    
    Windows Management Instrumentation (WMI) uses a different DATETIME object than the .NET Framework DateTime object that Get-Date returns. 
    To use DATETIME information from WMI in a command with DateTime information from Get-Date , you have to use the ConvertToDateTime method 
    to convert WMI CIM_DATETIME objects to .NET Framework DateTime objects.
    
    The commands in this example display the name and age of the BIOS on a remote computer, Server01.
    
    The first command uses the Get-WmiObject cmdlet to get an instance of the Win32_BIOS class on Server01 and then stores it in the $A 
    variable.
    
    The second command uses the pipeline operator (|) to send the WMI object stored in $A to the Format-List cmdlet. The Property parameter 
    of Format-List specifies two properties to display in the list, Name and BIOS Age. The BIOS Age property is specified in a hash table. 
    The table includes the Label key, which specifies the name of the property, and the Expression key, which contains the expression that 
    calculates the BIOS age. The expression uses the ConvertToDateTime method to convert each instance of ReleaseDate to a .NET Framework 
    DateTime object. Then, the value is subtracted from the value of the Get-Date cmdlet, which, without parameters, gets the current date.
    Example 8: Get the long date and long time format for the current date and time
    
    PS C:\>Get-Date
    Tuesday, June 13, 2006 12:43:42 PM
    
    This command gets a DateTime object and displays the current date and time in the long date and long time formats for the system locale, 
    as though you typed `Get-Date -Format F`.
    Example 9: Convert a DateTime object to a string and add it to a file
    
    PS C:\>Get-Date
    Tuesday, September 26, 2006 11:25:31 AM PS C:\>(Get-Date).ToString()
    9/26/2006 11:25:31 AM PS C:\>Get-Date | Add-Content Test.txt
    # Adds 9/26/2006 11:25:31 AM PS C:\>Get-Date -Format F | Add-Content Test.txt
    # Adds Tuesday, September 26, 2006 11:25:31 AM
    
    These commands demonstrate how to use Get-Date with Add-Content and other cmdlets that convert the DateTime object that Get-Date 
    generates to a string.
    
    The first command shows that the default display from a Get-Date command is in long-date and long-time format.
    
    The second command shows that the default display from the ToString() method of the DateTime object is in short-date and short-time 
    format.
    
    The third command uses a pipeline operator to send the DateTime object to the Add-Content cmdlet, which adds the content to the Test.txt 
    file. Because Add-Content uses the ToString() method of the DateTime object, the date that is added is in short-date and short-time 
    format.
    
    The fourth command uses the Format parameter of Get-Date to specify the format. When you use the Format or UFormat parameters, Get-Date 
    generates a string, not a DateTime object. Then, when you send the string to Add-Content , it adds the string to the Test.txt file 
    without changing it.
    Example 10: Create a timestamp to use to name a directory
    
    The first command uses the *Format* parameter with a value of o to generate a timestamp string.
    PS C:\>Get-Date -Format o
    2012-03-08T10:55:55.6083839-08:00
    
    The second command prepares the timestamp to be used in a directory name. The command replaces the colon characters (:) in the string 
    with dots (.) and saves the result in the $TimeStamp variable. Replacing the colons prevents the characters that precede each colon from 
    being interpreted as a drive name.
    PS C:\>$TimeStamp = Get-Date -Format o | foreach {$_ -replace ":", "."}
    
    The third command uses the Mkdir function to create a directory with the name in the $TimeStamp variable.
    PS C:\>mkdir C:\ps-test\$TimeStamp
    Directory: C:\ps-test
    
    Mode                LastWriteTime     Length Name
    ----                -------------     ------ ----
    d----          3/8/2012  11:01 AM            2012-03-08T11.00.24.4192623-08.00
    
    This example shows how to use the Get-Date cmdlet to create a timestamp and how to use the timestamp in or as part of a directory name.




